import React from 'react';

const Contactenos = () => {
  return (
    <main style={styles.main}>
      <h1 style={styles.title}>Cont√°ctenos</h1>
      <h2 style={styles.subtitle}>Equipo De Trabajo</h2>
      <div style={styles.imageContainer}>
        <div style={styles.imageBox}>
          <img
            src="/images/juan.png"
            alt="imagen-1"
            style={styles.image}
          />
          <p style={styles.imageLabel}>Juan</p>
        </div>
        <div style={styles.imageBox}>
          <img
            src="/images/andres.jpg"
            alt="imagen-2"
            style={styles.image}
          />
          <p style={styles.imageLabel}>Andres</p>
        </div>
        <div style={styles.imageBox}>
          <img
            src="/images/portada.jpg"
            alt="imagen-3"
            style={styles.image}
          />
          <p style={styles.imageLabel}>Luz</p>
        </div>
      </div>
    </main>
  );
};

const styles = {
  main: {
    padding: '2rem',
    fontFamily: 'Arial, sans-serif',
    maxWidth: '900px',
    margin: '0 auto',
    textAlign: 'center'
  },
  title: {
    fontSize: '2.5rem',
    color: '#F5F5F5',
    marginBottom: '1.5rem',
  },
  subtitle: {
    color: "#F5F5F5"
  },
  image: {
    width: '250px',
    height: 'auto',
    marginButtom: '1rem'
  },
  imageLabel: {
    color: '#F5F5F5',
    fontSize: '2rem'
  }
}

export default Contactenos;
